import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar'; // Asegúrate de importar el componente correctamente
import AgregarProducto from './components/AgregarProducto'; // Asegúrate de importar tus componentes
import AgregarProveedor from './components/AgregarProveedor'; // Lo mismo aquí

function App() {
  return (
    <Router>
      <Navbar /> 
      <div className="container">
        <Routes>
          {/* rutas para de las paginas y lo que necesitan */}
          <Route path="/productos" element={<AgregarProducto />} />
          <Route path="/proveedores" element={<AgregarProveedor />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
